struct Vector world_to_screen(struct Vector pos, int bottom)
{
	pos.y -= bottom;
	pos.y = screenHeight - pos.y;

	return pos;
}

void checkKey(bool* keyBool, unsigned char code)
{
	if (key1 == code && key2 == 0xE0)
	{
		*keyBool = true;
	}

	if (key1 == code && key2 == 0xF0)
	{
		*keyBool = false;
	}

	if (key1 == 0x29 && key2 != 0xF0)
	{
		*keyBool = true;
	}

	if (key1 == 0x29 && key2 == 0xF0)
	{
		*keyBool = false;
	}
}

void updateKeys()
{
	int data = *PS2_ptr;

	if (data & 0x8000)
	{
		key2 = key1;
		key1 = data & 0xFF;
	}

	checkKey(&leftArrow, 0x6B);
	checkKey(&rightArrow, 0x74);
	checkKey(&space, 0x29);
}

void displayScore(int score) {
    // Array to store individual digits of the score
    int digits[6] = {0};

    // Extract digits from the score
    for (int i = 0; i < 6; ++i) {
        digits[i] = score % 10; // Extract least significant digit
        score /= 10; // Remove least significant digit
    }

    // Display each digit on the seven-segment displays
    *HEX_BASE1 = (segments[digits[3]] << 24) | (segments[digits[2]] << 16) | (segments[digits[1]] << 8) | (segments[digits[0]]);
	*HEX_BASE2 = (segments[digits[5]] << 8) | (segments[digits[4]]);
}
